    return (
        <LoginContainer>
            <LoginForm />
        </LoginContainer>
    )
}

export default Login

const LoginContainer = styled.div`
    margin: 0 !important;
    padding: 0;
    background-color: white;
    min-height: 200vh;
    text-align: left;

    display: flex;
    justify-content: center;
    align-items: center;
    min-height: 90vh;

    h1 {
        margin: 0;
    }
`
